      "         <h1 class=\"article_title\">\n",
      "          First Use of Mars Rover Curiosity's Dust Removal Tool\n",
      "         </h1>\n",
      "        </header>\n",
      "        <figure class=\"lede\">\n",
      "         <a href=\"/spaceimages/images/largesize/PIA16565_hires.jpg\">\n",
      "          <img alt=\"This image from the Mars Hand Lens Imager on NASA's Mars rover Curiosity shows the patch of rock cleaned by the first use of the rover's Dust Removal Tool (DRT). The tool is a motorized, wire-bristle brush on the turret at the end of the rover's arm.\" class=\"main_image\" src=\"/spaceimages/images/largesize/PIA16565_hires.jpg\" title=\"This image from the Mars Hand Lens Imager on NASA's Mars rover Curiosity shows the patch of rock cleaned by the first use of the rover's Dust Removal Tool (DRT). The tool is a motorized, wire-bristle brush on the turret at the end of the rover's arm.\"/>\n",
      "         </a>\n",
      "        </figure>\n",
      "        <div class=\"clearfix\" id=\"primary_column\">\n",
      "         <div class=\"wysiwyg_content\">\n",
      "          <p>\n",
      "           This image from the Mars Hand Lens Imager (MAHLI) on NASA's Mars rover Curiosity shows the patch of rock cleaned by the first use of the rover's Dust Removal Tool (DRT).\n",
      "          </p>\n",
      "          <p>\n",
      "           The tool is a motorized, wire-bristle brush on the turret at the end of the rover's arm. Its first use was on the 150th Martian day, or sol, of the mission (Jan. 6, 2013). MAHLI took this image from a distance of about 10 inches (25 centimeters) after the brushing was completed on this rock target called \"Ekwir_1.\" The patch of the rock from which dust has been brushed away is about 1.85 inches by 2.44 inches (47 millimeters by 62 millimeters). The scale bar at bottom right is 1 centimeter (0.39 inch).\n",
      "          </p>\n",
      "          <p>\n",
      "           A view of Curiosity's turret at\n",
      "           <a href=\"https://photojournal.jpl.nasa.gov/catalog/PIA15699\">\n",
      "            PIA15699\n",
      "           </a>\n",
      "           shows the DRT on the right side of the image and the MAHLI at the center.\n",
      "          </p>\n",
      "          <p>\n",
      "           Honeybee Robotics, New York, N.Y., built the DRT for Curiosity. Malin Space Science Systems, San Diego, built the MAHLI.\n",
      "          </p>\n",
      "          <p>\n",
      "           JPL, a division of the California Institute of Technology, Pasadena, manages the Mars Science Laboratory Project for NASA's Science Mission Directorate, Washington. JPL designed and built the project's Curiosity rover.\n",
      "          </p>\n",
      "          <p>\n",
      "           For more about NASA's Curiosity mission, visit:\n",
      "           <a href=\"http://www.jpl.nasa.gov/msl\" target=\"new\">\n",
      "            http://www.jpl.nasa.gov/msl\n",
      "           </a>\n",
      "           ,\n",
